import { useEffect, useState } from "react";
import api from "../api"

type Props = {
  categoryName: string;
};
export interface Question {
  id: string;
  name: string;
  description?: any;
  createdAt: Date;
  updatedAt: Date;
  categoryId: string;
}

export interface QuestionObject {
  name: string;
  questions: Question[];
  resposta: number;
}

export const MapQuestions =(categoryName: Props) => {
  const [questions, setQuestions] = useState<QuestionObject[]>();

  async function getCateriesWithQuestions() {
    const { data } = await api.get<QuestionObject[]>(
      `question?category.name${categoryName}`
    );
    setQuestions(data);
  }
  const getQuestions= async ()=>{
    await getCateriesWithQuestions()
  }
  useEffect(() => {

    getQuestions();
  }, []);

return (
    <form>
      <div>Card</div>
      {questions?.map((question, index) => {
        return (
        <div key={Math.random() + index * 2}>
              <div id="group1"> 
                <label htmlFor="QuestionName">{question.name}</label><br />
                <input type="radio" value="1" name={question.name}></input>
                <input type="radio" value="2" name={question.name}></input>
                <input type="radio" value="3" name={question.name}></input>
                <input type="radio" value="4" name={question.name}></input>
                <input type="radio" value="5" name={question.name}></input>
              </div>
          </div>
        );
      })}
      <button>Anterior</button>
      <button>Proximo</button>
    </form>
  );


}
